import { createChatBotMessage } from "react-chatbot-kit";
import { Avatar } from "@mui/material";
import logo from "../assets/doctor.png";
const botName = "MedAI Bot";
const Config = {
  initialMessages: [createChatBotMessage(`Namaste`)],
  botName: botName,
  customComponents: {
    botAvatar: (props) => (
      <Avatar sx={{ background: "black" }}>
        <img src={logo} alt="avatar" width={30} />
      </Avatar>
    ),
    userAvatar: (props) => <Avatar sx={{ background: "orange" }}>
        User
    </Avatar>,
  },
};

export default Config;
